import Movie from './movie';
import movieList from '../data/movielist';
import '../styles/style.scss';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = null
    }

    // componentWillMount(){
    //     console.log(movieList)
    // }

    render() { 

        return (  
            <React.Fragment>
                {
                movieList.forEach(element => {
                <div>{element.posterurl}</div> 
                })
                }
            </React.Fragment>
        );
    }
}

export default App;
